import React from 'react';
import { Link } from 'react-router-dom';
import backgroundImg from '../assets/background.jpg'; // Reemplaza con la ruta correcta
import bookImg from '../assets/book.jpg'; // Reemplaza con la ruta correcta
import authorImg from '../assets/author.jpg'; // Reemplaza con la ruta correcta
import studentImg from '../assets/student.jpg'; // Reemplaza con la ruta correcta
import loanImg from '../assets/loan.jpg'; // Reemplaza con la ruta correcta

function HomePage() {
  return (
    <div className="home-container" style={{ backgroundImage: `url(${backgroundImg})` }}>
      {/* Navbar */}
      <nav className="custom-navbar navbar navbar-expand-lg navbar-dark fixed-top">
        {/* Contenido del Navbar */}
      </nav>

      {/* Header */}
      <header className="header">
        <div className="overlay text-white text-center">
          <h1 className="display-2 font-weight-bold my-3">Food Hut</h1>
          <h2 className="display-4 mb-5">Always fresh &amp; Delightful</h2>
          <a className="btn btn-lg btn-primary" href="#gallary">View Our gallary</a>
        </div>
      </header>

      {/* Acerca de */}
      <div className="container-fluid wow fadeIn" id="about">
        {/* Contenido de Acerca de */}
      </div>

      {/* Galería */}
      <div className="text-center bg-dark text-light has-height-md middle-items wow fadeIn" id="gallary">
        {/* Contenido de Galería */}
      </div>
      <div className="gallary row">
        {/* Contenido de las imágenes de la galería */}
      </div>

      {/* Reservar una mesa */}
      <div className="container-fluid has-bg-overlay text-center text-light has-height-lg middle-items" id="book-table">
        {/* Contenido de Reservar una mesa */}
      </div>

      {/* Blog */}
      <div className="container-fluid bg-dark text-light py-5 text-center wow fadeIn" id="blog">
        {/* Contenido de Blog */}
      </div>

      {/* Testimonios */}
      <div className="container-fluid wow fadeIn bg-dark text-light has-height-lg middle-items" id="testmonial">
        {/* Contenido de Testimonios */}
      </div>

      {/* Contacto */}
      <div className="container-fluid bg-dark text-light border-top wow fadeIn" id="contact">
        {/* Contenido de Contacto */}
      </div>

      {/* Footer */}
      <div className="container-fluid bg-dark text-light has-height-md middle-items border-top wow fadeIn">
        {/* Contenido de Footer */}
      </div>
      <div className="bg-dark text-light text-center border-top wow fadeIn">
        {/* Contenido adicional de Footer */}
      </div>
    </div>
  );
}

export default HomePage;
